    title: "Adhesives",
    tagline: "Specialty Products & Services",
    link: "/adhesives/",
    content:
      "<div>Insulation Products Corporation offers a complete line of Adhesive Products. From Instant Adhesives (Cyanoacrylates), Threadlockers and Sealers (Anaerobic), Structural Adhesives (Methacrylates) and Dispensing Equipment.<br /><br /><h3>Instant Adhesives (Cyanoacrylates)</h3><br /><br />No other adhesives offer a better combination of convenience, ease of use, dependability and strength. Whether bonding rubber, plastic, metal, wood or other surfaces, this adhesive will give you the ultimate in performance. Cyanoacrylates are used where an extremely fast fixture speed and where minimal spacing is required.<br /><br /><br /><br /><h3>Threadlockers, Sealing, Retaining and Gasketing (Anaerobics)</h3><br /><br />Whether you are looking for a locking/sealing solution on threaded fasteners, non-threaded assemblies (cylindrical, bearings, gears, shafts or pulleys), or form-in-place gaskets; we will have a product for you.<br /><br />This family of adhesives are engineered to provide the most consistent fixture and cure times in the industry. Domestic production means you get fresher and therefore faster performing materials.<br /><br /><h3>Structural Adhesives (1 and 2 part epoxies, Acrylics and Methacrylates)</h3><br /><br />We offer a complete line of epoxies, 1-part and 2-part, for bonding, encapsulating and potting applications for all types of industries. Our 2-part methacrylates are designed for structural bonding of most metals, thermoplastics and composites. There are great solutions for marine, automotive and industrial applications.<br /><br /><h3>Sealants</h3><br /><br />These products are designed to meet a variety of bonding and sealing applications. Extremely versatile and designed to provide good adhesion and sealing properties for many different applications. These can be used on glass, ceramics, masonry, wood, painted surfaces, metal and plastics.<br /><br /><h3>Application Systems</h3><br /><br />Our dispensing equipment is reliable, consistent and dependable. We offer solutions from hand held applicators to fully automated systems, microprocessor controllers, precision dispensing valves and a complete family of accessories. With engineers on site, we will be able to create a solution to your adhesive requirements. We are here for all your adhesive requirements.</div>",
