    content:
      '<h2>Identification Markers for Wire &amp; Cable</h2>\n<ul>\n \t<li>Hot stamped on shrinkable or non-shrinkable tubing and cable ties</li>\n \t<li>Large stock of tubing and cable ties for immediate delivery</li>\n \t<li>Custom made to your specifications</li>\n \t<li>No minimum quantity</li>\n</ul>\nInsulation Products Corporation\'s hot stamp wire markers are a low cost, simple, attractive and completely dry process for marking or coding wire, cable, ropes and other parts for identification.\n\nHot stamp markers identify or finish products to improve profits by increasing production, efficiency and appearance. Parts can be customized with manufacturers’ logo, part number, date code and serial number on all types of sleevings, heat shrinkable tubing and cable ties. A wide selection of type sizes, tubing colors and imprint colors give that finished look to your product.\n\nInsulation Products Corporation will mark on U/L, CSA and military approved materials with a quality permanent imprint, cut to length and package to the customer\'s needs. No minimum quantity is required per order. With new, high speed, automated, cutting and stamping equipment, orders are normally shipped in one to two weeks.\n\nOrdering Data &amp; Specifications:\n<ul>\n \t<li>Type is standard Gothic unless otherwise specified</li>\n \t<li>Standard print color is black or white (other colors available)</li>\n \t<li>Tubing sizes from 3/64" up to 5" diameter</li>\n \t<li>Standard character sizes from 1/16" to 1/2"</li>\n \t<li>Custom sizes available</li>\n \t<li>Markings on both sides available</li>\n \t<li>Serialization available</li>\n \t<li>On the chart to the right "D" is the inside diameter</li>\n \t<li>"L" is the length to cut the tubing</li>\n \t<li>Maximum 6 lines of type using 1/8" characters</li>\n \t<li>We will mark to these Military Specifications\n<ul>\n \t<li>MIL-STD-130: Identification marking of U.S. Military property</li>\n \t<li>MIL-M-81531: Marking of electrical insulating materials</li>\n \t<li>MIL-M-60903: Marking of electrical wires and cables (#7444)</li>\n</ul>\n</li>\n</ul>',
