      "Insulation Products Corporation carries a complete line of UL &amp; CUL listed conduit couplings.\n\nProduced from UV rated material for long outdoor life, these couplings feature an attractive one-piece design. Applications include: outdoor lighting, assemblies, applications for long conduit runs, wire protection and locations where type B conduit is used.\n\nLess waste! No need to throw away those odd length pieces! Simply screw the coupling unto two pieces simultaneously to make one continuous piece.\n\nYou can snake long lengths of conduit with ease by cutting the conduit, placing wire and then reconnecting. The unique nonmetallic liquid-tight conduit coupling design allows a superior liquid-tight seal &amp; optimum pull strength.\n\nAre you looking for more information about any of our products at IPC? Check out our Contact Us page for easy communication. Customers are our first priority and we continue to strive for excellence in everything we do. We look forward to working with you.",
