      'Insulation Products Corporation carries a complete line of nonmetallic, flexible, electrical tubing connectors, featuring all nylon construction that resists salt water, weak acids, gasoline, alcohol, grease&amp; other common solvents. Smooth internal surfaces for easier wire installation.\n\nThey are available in sizes from 3/8" thru 2" in both straight and 90° elbow styles.\n\nThis complete conduit/connector system is reusable. The conduit will not wind tight onto the connector during assembly &amp; can be easily removed by pulling while turning in a clockwise direction. Connectors are suitable for indoor/outdoor use; for original equipment manufacturers of field installers.\n\nMolded of type nylon 6. Flammability classification 94V-2; temperature index 125°C\n\n“O” ring &amp; steel locknut included.\n\nDo you need more information about our electrical nonmetallic tubing connectors or any of our corresponding products? Contact us at 1.630.771.0700, today!',
