    title: "PVC Non-Shrink",
    tagline: "Non-Shrink Tubing",
    link: "/pvc-non-shrink/",
    content:
      'Non-Shrink PVC Tubing\n\nInsulation Products Corporation carries an assortment of flame-retardant non-shrink PVC tubing that is available in various styles and colors. It has excellent electrical, chemical and physical properties that make it all-purpose tubing.\n\n&nbsp;\n\nLow Temperature Vinyl Tubing – \n\nProduct Number: <a href="low-temperature-vinyl-tubing-2/">IP1274</a> <img class="alignright" src="wp-content/uploads/2016/07/IP1274.png" alt="A superior low temperature PVC tubing." />\n<ul>\n \t<li>Low Temperature Flexibility</li>\n \t<li>Flame Retardant</li>\n \t<li>Designed for aircraft devices</li>\n</ul>\nA low temperature extruded PVC electrical insulation tubing designed for aeronautical applications, general purpose bundling, harnessing, and many other uses.\n\nIP1274 has a very soft durometer (71 Shore A) which makes it extremely flexible and also has a high cut-through resistance.  It meets the requirements of MIL-I-7444 Types 1&amp;3 and MIL-I-22076.\n\n&nbsp;\n\nExtruded 105° Vinyl Tubing – \n\nProduct Number: <a href="pvc-non-shrink/extruded-105-vinyl-tubing/">IP10EX</a>\n\n<ul>\n \t<li>High Temperature<img class="alignright" src="wp-content/uploads/2016/07/ip17tw.jpg" alt="A superior high dielectric strength 105oC PVC tubing" /></li>\n \t<li>U/L recognized CSA certified</li>\n \t<li>Low cost</li>\n</ul>\nHigh temperature extruded PVC tubing designed for electrical applications, general purpose bundling, and many other uses.\n\n105°C vinyl tubing is a low cost, flexible vinyl with excellent electrical, mechanical and thermal properties for applications up to 105°C. It carries Underwriters Laboratories recognition and is rated VW-1 along with Canadian Standards Association certification.  IP10EX meets the requirements of MIL-I-631D, Grade C.\n\nThis tubing is available with standard wall thickness shown below along with a .032" wall thickness in sizes #24 thru 1/2" on special order where 600V rating is needed.\n\n&nbsp;\n\nGeneral Purpose Vinyl Tubing – \n\nProduct Number: <a href="pvc-non-shrink/general-purpose-vinyl-tubing/">IP12GA</a><img class="alignright" src="wp-content/uploads/2016/07/ip12ga.jpg" alt="A superior general purpose PVC tubing" />\n<ul>\n \t<li>Exceptional Temperature Range</li>\n \t<li>Flame Retardant</li>\n \t<li>Flexible</li>\n</ul>\nIP12GA is a general purpose, extruded PVC tubing with a wide temperature range designed for appliances, electric motors, commercial and military aircraft, general purpose bundling, harnessing, and many other uses that require a low temperature tubing that remains flexible.\n\nIP12GA has a high dielectric strength, excellent flexibility, fungus resistance and is non-corrosive.  It meets the requirements of MIL-I-631D, Grades A &amp; B.\n\n&nbsp;\n\nFractional Wall Plastic Tubing – \n\nProduct Number: <a href="pvc-non-shrink/fractional-wall-plastic-tubing/">IP15PV</a> <img class="alignright" src="wp-content/uploads/2016/07/IP15PV.jpg" alt="Great for low pressure FDA applications" />\n<ul>\n \t<li>Food Grade Vinyl Tubing</li>\n \t<li>Heavy wall</li>\n \t<li>Kink resistant</li>\n</ul>\nIP15PV is great for low pressure FDA applications. Virgin materials are used for this Food and Drug Administration approved Vinyl tubing.\n\nVinyl tubing is clear, smooth, flexible, corrosion-resistant, non-aging and non-oxidizing. Meets tests such as U.S. Pharmacopoeia Classes I through VI and the criteria set forth by Federal Specification L-T-790B for laboratory and medical tubing (including oxygen handling).\n\nSold from stock in 100 ft. coils (up to 11/16" x 15/16" x 1/8" wall) and in 50\' lengths (11/16" x 1" x 5/32" wall and larger). Cut pieces or special lengths on quotation. Contact our friendly and helpful sales representatives to learn more at 1.630.771.0700 or email us at <a href="mailto:sales@insulationproducts.com">sales@insulationproducts.com</a>.\n\n&nbsp;',
