    content:
      '<div id="productPageTop" class="row">\n<div id="productImage" class="col-lg-4 col-md-4 col-sm-4 col-xs-12"><img src="wp-content/uploads/2016/07/download.png" alt="Shrink over terminals for insulation and strain relief." width="360" /></div>\n<div id="productSummary" class="col-lg-8 col-md-8 col-sm-8 col-xs-12">\n<h2>Product Number IP47HV</h2>\n<ul class="summaryList">\n \t<li>3:1 Shrink Polyolefin</li>\n \t<li>Environmental protection</li>\n \t<li>Tough heavy wall</li>\n</ul>\n\n<hr />\n\n<div class="summaryText">Heavy duty jacketing with adhesive liner</div>\n</div>\n</div>\n<div id="productPageBottom" class="row">\n<div id="productDescription" class="col-lg-8 col-md-8 col-sm-12 col-xs-12">Heavy Wall heat shrink tubing is a thermally stabilized, modified polyolefin, heat shrinkable tubing. It provides a simpler, more positive splice sealing method that offers greater protection under the most adverse environmental conditions. A relatively small number of sizes covers a large number of cable sizes because of the high shrink ratio. Seals may be made over lead, steel, aluminum, copper, and all standard plastic and elastomeric insulating materials. The standard tubing is supplied with an adhesive to provide optimum water-proofing and environmental protection in submersible or direct buried applications. This tubing can also be supplied in medium wall (product #IP46) where wall constraint is a factor. Both tubings are rated for continuous operating temperature up to 90°C for non-pressurized cable systems.</div>\n<div id="productBoxes" class="col-lg-4 col-md-4 col-sm-12 col-xs-12">\n<dl>\n \t<dd>U/L Approved</dd>\n \t<dd>AMS-DTL-23053/ 15 Class 1, Class 2 - IP46</dd>\n \t<dd>(QPL products available upon request)</dd>\n</dl>\n<dl>\n \t<dt>Dielectric Strength:</dt>\n \t<dd> @ 150 mils 250 volts/mi</dd>\n \t<dt>Tensile Strength:</dt>\n \t<dd>2400 psi</dd>\n \t<dt>Water Absorption:</dt>\n \t<dd>0.05%</dd>\n \t<dt>Solvent Resistance:</dt>\n \t<dd>Excellent</dd>\n \t<dt>Standard Length:</dt>\n \t<dd>48"</dd>\n</dl>\n</div>\n<div id="productSpecs" class="col-xs-12">\n<h2>Specifications:</h2>\n<table class="tabledata">\n<thead>\n<tr>\n<th>Order Size</th>\n<th>Expanded Diameter</th>\n<th>Recovered Diameter</th>\n<th>Recovered Heavy</th>\n<th>Wall Medium</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>3/8"</td>\n<td>.400</td>\n<td>.150</td>\n<td>.080</td>\n<td>.080</td>\n</tr>\n<tr>\n<td>3/4"</td>\n<td>.750</td>\n<td>.220</td>\n<td>.105</td>\n<td>.080</td>\n</tr>\n<tr>\n<td>1"</td>\n<td>1.100</td>\n<td>.375</td>\n<td>.120</td>\n<td>.080</td>\n</tr>\n<tr>\n<td>1-1/2"</td>\n<td>1.500</td>\n<td>.500</td>\n<td>.140</td>\n<td>.080</td>\n</tr>\n<tr>\n<td>2"</td>\n<td>2.000</td>\n<td>.750</td>\n<td>.155</td>\n<td>.080</td>\n</tr>\n<tr>\n<td>3"</td>\n<td>3.000</td>\n<td>1.250</td>\n<td>.155</td>\n<td>.080</td>\n</tr>\n<tr>\n<td>4-1/2”</td>\n<td>4.500</td>\n<td>1.500</td>\n<td>.170</td>\n</tr>\n<tr>\n<td>6"</td>\n<td>6.000</td>\n<td>1.800</td>\n<td>.170</td>\n</tr>\n<tr>\n<td>7"</td>\n<td>7.000</td>\n<td>2.000</td>\n<td>.170</td>\n</tr>\n</tbody>\n</table>\n</div>\n</div>\n&nbsp;\n\n<a href="wp-content/uploads/2018/08/IP46MD-IP47HV.pdf" target="_blank" rel="noopener">Download Our Spec Sheet</a>',
