    content:
      '<div id="productPageTop" class="row">\n<div id="productImage" class="col-lg-4 col-md-4 col-sm-4 col-xs-12"><img src="wp-content/uploads/2016/07/IP35KY.png" alt="Shrink over terminals for insulation and strain relief." width="360" /></div>\n<div id="productSummary" class="col-lg-8 col-md-8 col-sm-8 col-xs-12">\n<h2>Product Number IP35KY</h2>\n<ul class="summaryList">\n \t<li>Semi-rigid</li>\n \t<li>High Dielectric</li>\n \t<li>U/L CSA</li>\n</ul>\n\n<hr />\n\n<div class="summaryText">A very thin wall high dielectric tubing</div>\n</div>\n</div>\n<div id="productPageBottom" class="row">\n<div id="productDescription" class="col-lg-8 col-md-8 col-sm-12 col-xs-12">\n\nHeat Shrinkable Kynar Tubing is an irradiated, thin-wall tubing offering a high degree of mechanical strength and high temperature resistance. Kynar tubings are fabricated from polyvinylidene fluoride which gives outstanding abrasion resistance and cut-through properties in combination with high dielectric strength. Kynar is inherently flame retardant and semi-rigid. It is highly resistant to most industrial fuels, chemicals and solvents.\n\nKynar tubings shrink at 350°F on applications such as jacketing for components, fuse coverings and capacitor protection. Because the tubing is transparent, it offers see-thru inspection and identification.\n\nApplication of heat above 121°C will shrink this tubing quickly to 50% of its supplied diameter or snug down on the object it is to cover.\n\nHeat Shrinkable Kynar is excellent for strain relief applications. It can be flexed, twisted and bent repeatedly without loss of mechanical or electrical strength. Because of its thin wall, Kynar can be used in areas where space is limited.\n\n</div>\n<div id="productBoxes" class="col-lg-4 col-md-4 col-sm-12 col-xs-12">\n<dl>\n \t<dd>U/L Subject 224 VW-1</dd>\n \t<dd>CSA OFT</dd>\n \t<dd>AMS-3632C</dd>\n \t<dd>AMS-DTL-23053/8</dd>\n \t<dd>(QPL product available upon request)</dd>\n</dl>\n<dl>\n \t<dt>Temperature Ratings:</dt>\n \t<dd>Continuous operation from -55°C to 175°C</dd>\n \t<dt>Electrical:</dt>\n \t<dd>800-1000 Volts per mil (withstands 2000 volts for 1 min.)</dd>\n \t<dt>Heat Resistance:</dt>\n \t<dd>168 hours @ 250°C</dd>\n \t<dt>Heat Shock:</dt>\n \t<dd>4 hours @ 300°C no cracks, flowing or dripping</dd>\n \t<dt>Colors:</dt>\n \t<dd>Clear (transparent) and Black</dd>\n \t<dt>Markers and Cut Pieces:</dt>\n \t<dd>Cutting and printing on this tubing available upon request</dd>\n</dl>\n</div>\n<div id="productSpecs" class="col-xs-12">\n<h2>Specifications:</h2>\n<table class="tabledata">\n<thead>\n<tr>\n<th>Order Size</th>\n<th>Expanded Diameter</th>\n<th>Recovered Diameter</th>\n<th>Recovered Wall</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>3/64"</td>\n<td>.046"</td>\n<td>.023"</td>\n<td>.010</td>\n</tr>\n<tr>\n<td>1/16"</td>\n<td>.063"</td>\n<td>.031"</td>\n<td>.010</td>\n</tr>\n<tr>\n<td>3/32"</td>\n<td>.093"</td>\n<td>.046"</td>\n<td>.010</td>\n</tr>\n<tr>\n<td>1/8"</td>\n<td>.125"</td>\n<td>.062"</td>\n<td>.010</td>\n</tr>\n<tr>\n<td>3/16"</td>\n<td>.187"</td>\n<td>.093"</td>\n<td>.010</td>\n</tr>\n<tr>\n<td>1/4"</td>\n<td>.250"</td>\n<td>.125"</td>\n<td>.012</td>\n</tr>\n<tr>\n<td>3/8"</td>\n<td>.375"</td>\n<td>.187"</td>\n<td>.012</td>\n</tr>\n<tr>\n<td>1/2"</td>\n<td>.500"</td>\n<td>.250"</td>\n<td>.012</td>\n</tr>\n<tr>\n<td>3/4"</td>\n<td>.750"</td>\n<td>.375"</td>\n<td>.017</td>\n</tr>\n<tr>\n<td>1"</td>\n<td>1.000"</td>\n<td>.500"</td>\n<td>.018</td>\n</tr>\n<tr>\n<td>1-1/2"</td>\n<td>1.500"</td>\n<td>.750"</td>\n<td>.020"</td>\n</tr>\n</tbody>\n</table>\n<a href="wp-content/uploads/2018/08/IP35KY.pdf" target="_blank" rel="noopener">Download Our Spec Sheet</a>\n\n</div>\n</div>',
