    content:
      '<div id="productPageTop" class="row">\n<div id="productImage" class="col-lg-4 col-md-4 col-sm-4 col-xs-12"><img src="wp-content/uploads/2016/07/IP48MH.png" alt="Thin wall, high dielectric, for tight spaces" width="360" /></div>\n<div id="productSummary" class="col-lg-8 col-md-8 col-sm-8 col-xs-12">\n<h2>Product Number IP48MH</h2>\n<ul class="summaryList">\n \t<li>High Dielectric</li>\n \t<li>Very thin wall</li>\n \t<li>High longitudinal shrinkage</li>\n</ul>\n\n<hr />\n\n<div class="summaryText">Thin wall, high dielectric, for tight spaces</div>\n</div>\n</div>\n<div id="productPageBottom" class="row">\n<div id="productDescription" class="col-lg-8 col-md-8 col-sm-12 col-xs-12">\n\nMylar Heat Shrink Tubing is a superior, high dielectric insulation material that provides a tight, smooth protective covering. It is extremely easy to use and is suitable for hand or machine application, with no special or costly shrinking equipment necessary. Mylar tubing may be shrunk by heat guns, electrical coil heaters or ovens. It is shrinkable by as much as 50% of its diameter in order to provide an immovable, tight fit. Temperature requirements are as low as 90°C for shrinking purposes with a heat cycle as short as one second.\n\nMylar Heat Shrink is spiral wound to practically any diameter and length. It is an excellent choice for both high temperature and electrical insulation; for protection of coils and components; or as a replacement for tape\n\nPhysical property values are published by DuPont and are typical for 65 gauge Mylar polyester film. Further information on Mylar film is available from the DuPont Co. Our Engineering Dept. will be glad to work with you on individual requests.\n\n</div>\n<div id="productBoxes" class="col-lg-4 col-md-4 col-sm-12 col-xs-12">\n<dl>\n \t<dd>AMS-DTL-23053/7</dd>\n \t<dd>Dielectric Strength (VPM min.) 1,500</dd>\n \t<dd>Tensile Strength (PSI) 20,000</dd>\n \t<dd>Elongation 75%</dd>\n</dl>\n<dl>\n \t<dt>Shrinkage:</dt>\n \t<dd> (@100°C)</dd>\n \t<dt>Machine Direction-Min:</dt>\n \t<dd>35%</dd>\n \t<dt>Machine Direction-Max:</dt>\n \t<dd>55%</dd>\n \t<dt>Transverse Direction-Min:</dt>\n \t<dd>45%</dd>\n \t<dt>Transverse Direction-Max:</dt>\n \t<dd>60%</dd>\n \t<dt>Melting Point (C):</dt>\n \t<dd>245°+</dd>\n \t<dt>Density (Average):</dt>\n \t<dd>1.348</dd>\n \t<dt>Thickness-Min. Mils:</dt>\n \t<dd>.55</dd>\n \t<dt>Thickness-Max. Mils:</dt>\n \t<dd>.78</dd>\n \t<dt>Water Absorption:</dt>\n \t<dd>0.8%</dd>\n \t<dt>Dielectric Constant:</dt>\n \t<dd>3.9-3.9</dd>\n \t<dt>Temperature Range:</dt>\n \t<dd>-60°C to + 150°C</dd>\n</dl>\n</div>\n<div id="productSpecs" class="col-xs-12">\n<h2>Specifications:</h2>\n<table class="tabledata">\n<thead>\n<tr>\n<th>Order Size</th>\n<th>Expanded Diameter</th>\n<th>Recovered Diameter</th>\n<th>Recovered Wall</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>1/16”</td>\n<td>.062”</td>\n<td>.037”</td>\n<td>2-4 mil.</td>\n</tr>\n<tr>\n<td>3/32”</td>\n<td>.093”</td>\n<td>.055”</td>\n<td>2-4 mil.</td>\n</tr>\n<tr>\n<td>1/8”</td>\n<td>.125”</td>\n<td>.075”</td>\n<td>2-4 mil.</td>\n</tr>\n<tr>\n<td>3/16”</td>\n<td>.187”</td>\n<td>.112”</td>\n<td>2-4 mil.</td>\n</tr>\n<tr>\n<td>1/4”</td>\n<td>.250”</td>\n<td>.150”</td>\n<td>2-4 mil.</td>\n</tr>\n<tr>\n<td>5/16”</td>\n<td>.313”</td>\n<td>.187”</td>\n<td>2-4 mil.</td>\n</tr>\n<tr>\n<td>3/8"</td>\n<td>.375"</td>\n<td>.225”</td>\n<td>2-4 mil.</td>\n</tr>\n<tr>\n<td>1/2"</td>\n<td>.500"</td>\n<td>.300”</td>\n<td>2-4 mil.</td>\n</tr>\n<tr>\n<td colspan="4">This material is a custom run product. The sizes above are stock items at this time but are not guaranteed in the future. Please contact sales for any size not shown above.\n\n<a href="wp-content/uploads/2016/07/IP48MH-2016.pdf" target="_blank" rel="noopener">Download Our Spec Sheet</a>\n\n&nbsp;</td>\n</tr>\n</tbody>\n</table>\n</div>\n</div>',
