      '<div id="productPageTop" class="row">\n<div id="productImage" class="col-lg-4 col-md-4 col-sm-4 col-xs-12"><img src="wp-content/uploads/2016/07/IP29CG.png" alt="Shrink over terminals for insulation and strain relief." width="360" /></div>\n<div id="productSummary" class="col-lg-8 col-md-8 col-sm-8 col-xs-12">\n<h2>Product Number IP29CG</h2>\n<ul class="summaryList">\n \t<li>General purpose flexible polyolefin</li>\n \t<li>Low shrink temperature</li>\n \t<li>Excellent substitute for HS-PVC</li>\n</ul>\n\n<hr />\n\n<div class="summaryText">Shrink over terminals for insulation and strain relief.</div>\n</div>\n</div>\n<div id="productPageBottom" class="row">\n<div id="productDescription" class="col-lg-8 col-md-8 col-sm-12 col-xs-12">\n\nCommercial Grade Polyolefin Tubing is an irradiated, economical and mechanically tough heat shrinkable tubing used for insulating, jacketing and identification.\n\nIP29CG has excellent electrical, chemical and physical properties representing a good all purpose heat shrinkable tubing.\n\nApplication of heat above 100°C will shrink this tubing quickly to 50% of its supplied diameter or snug down on the object it is to cover.\n\nWhen comparing this product to heat shrinkable PVC, IP29CG offers reduced longitudinal shrinkage, better shelf-life, vivid colors and superior temperature characteristics.\n\n</div>\n<div id="productBoxes" class="col-lg-4 col-md-4 col-sm-12 col-xs-12">\n<dl>\n \t<dd>ROHS Compliant</dd>\n \t<dd>Corrosion Resistant\nSolvent Resistant\nHigh Gloss Finish Colors are vivid - Clear is “crystal” clear</dd>\n \t<dd></dd>\n</dl>\n<dl>\n \t<dt>Longitudinal Shrinkage:</dt>\n \t<dd> less than 5%</dd>\n \t<dt>Storage:</dt>\n \t<dd>very stable; can be stored over extended intervals without change.</dd>\n \t<dt>Temperature Rating:</dt>\n \t<dd> continuous operation from -55°C to 105°C.</dd>\n \t<dt>Electrical:</dt>\n \t<dd>550 volts per mil.</dd>\n \t<dt>Standard Colors:</dt>\n \t<dd> black, white, clear, red, blue, green and yellow (most sizes in brown, orange, violet and gray)</dd>\n \t<dt>Low Temp Flexibility:</dt>\n \t<dd> (4 hrs @ -55°C) No cracking</dd>\n</dl>\n</div>\n<div id="productSpecs" class="col-xs-12">\n<h2>Specifications:</h2>\n<table class="tabledata">\n<thead>\n<tr>\n<th>Order Size</th>\n<th>Expanded Diameter</th>\n<th>Recovered Diameter</th>\n<th>Recovered Wall</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>3/64"</td>\n<td>.046"</td>\n<td>.023"</td>\n<td>.018"</td>\n</tr>\n<tr>\n<td>1/16"</td>\n<td>.063"</td>\n<td>.031"</td>\n<td>.018"</td>\n</tr>\n<tr>\n<td>3/32"</td>\n<td>.093"</td>\n<td>.046"</td>\n<td>.020"</td>\n</tr>\n<tr>\n<td>1/8"</td>\n<td>.125"</td>\n<td>.062"</td>\n<td>.020"</td>\n</tr>\n<tr>\n<td>3/16"</td>\n<td>.187"</td>\n<td>.093"</td>\n<td>.020"</td>\n</tr>\n<tr>\n<td>1/4"</td>\n<td>.250"</td>\n<td>.125"</td>\n<td>.025"</td>\n</tr>\n<tr>\n<td>3/8"</td>\n<td>.375"</td>\n<td>.187"</td>\n<td>.025"</td>\n</tr>\n<tr>\n<td>1/2"</td>\n<td>.500"</td>\n<td>.250"</td>\n<td>.025"</td>\n</tr>\n<tr>\n<td>5/8"</td>\n<td>.625"</td>\n<td>.313"</td>\n<td>.025"</td>\n</tr>\n<tr>\n<td>3/4"</td>\n<td>.750"</td>\n<td>.375"</td>\n<td>.030"</td>\n</tr>\n<tr>\n<td>1"</td>\n<td>1.000"</td>\n<td>.500"</td>\n<td>.035"</td>\n</tr>\n<tr>\n<td>1-1/4"</td>\n<td>1.250"</td>\n<td>.625"</td>\n<td>.040"</td>\n</tr>\n<tr>\n<td>1-1/2"</td>\n<td>1.500"</td>\n<td>.750"</td>\n<td>.040"</td>\n</tr>\n<tr>\n<td>2"</td>\n<td>2.000"</td>\n<td>1.000"</td>\n<td>.045"</td>\n</tr>\n<tr>\n<td>3"</td>\n<td>3.000"</td>\n<td>1.500"</td>\n<td>.050"</td>\n</tr>\n<tr>\n<td>4"</td>\n<td>4.000"</td>\n<td>2.000"</td>\n<td>.055"</td>\n</tr>\n</tbody>\n</table>\n&nbsp;\n\n<a href="wp-content/uploads/2016/07/IP29CG-2016.pdf" target="_blank">Download Our Spec Sheet</a>\n\n</div>\n</div>',
