    content:
      '<div id="productPageTop" class="row">\n<div id="productImage" class="col-lg-4 col-md-4 col-sm-4 col-xs-12"><img src="wp-content/uploads/2016/07/IP34SR.png" alt="Shrink over terminals for insulation and strain relief." width="360" /></div>\n<div id="productSummary" class="col-lg-8 col-md-8 col-sm-8 col-xs-12">\n<h2>Product Number IP34SR</h2>\n<ul class="summaryList">\n \t<li>Great for strain relief</li>\n \t<li>Flame retardant</li>\n \t<li>MIL-Spec.</li>\n</ul>\n\n<hr />\n\n<div class="summaryText">Shrink over terminals for insulation and strain relief.</div>\n</div>\n</div>\n<div id="productPageBottom" class="row">\n<div id="productDescription" class="col-lg-8 col-md-8 col-sm-12 col-xs-12">\n\nHeat Shrinkable Polyolefin Tubing is a highly flexible, radiation cross-linked tubing used for insulating, jacketing and identification. It will not melt, is mechanically tough and will not split when shrunk.\n\nMade from flame-retardant polyolefin, it has excellent electrical, chemical and physical properties representing a good all purpose heat shrinkable tubing.\n\nApplication of heat above 135°C will shrink this tubing quickly to 50% of its supplied diameter or snug down on the object it is to cover.\n\nResists a wide range of chemicals and oils, as well as moisture and fungus\n\nCutting and printing on this tubing available upon request\n\n</div>\n<div id="productBoxes" class="col-lg-4 col-md-4 col-sm-12 col-xs-12">\n<dl>\n \t<dd>AMS-DTL-23053/6 Class 1; Clear - Class 2</dd>\n \t<dd>(QPL product available upon request)</dd>\n</dl>\n<dl>\n \t<dt>Longitudinal Shrinkage:</dt>\n \t<dd>less than 5%</dd>\n \t<dt>Storage:</dt>\n \t<dd>very stable; can be stored over extended intervals without change.</dd>\n \t<dt>Temperature Rating:</dt>\n \t<dd>continuous operation from –55°C to 135°C.</dd>\n \t<dt>Electrical:</dt>\n \t<dd>Minimum 2500V</dd>\n \t<dt>Standard Colors:</dt>\n \t<dd> black and clear. Other colors available upon request.</dd>\n</dl>\n</div>\n<div id="productSpecs" class="col-xs-12">\n<h2>Specifications:</h2>\n<table class="tabledata">\n<thead>\n<tr>\n<th>Order Size</th>\n<th>Expanded Diameter</th>\n<th>Recovered Diameter</th>\n<th>Recovered Wall</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>3/64"</td>\n<td>.046"</td>\n<td>.023"</td>\n<td>.018"</td>\n</tr>\n<tr>\n<td>1/16"</td>\n<td>.063"</td>\n<td>.031"</td>\n<td>.018"</td>\n</tr>\n<tr>\n<td>3/32"</td>\n<td>.093"</td>\n<td>.046"</td>\n<td>.020"</td>\n</tr>\n<tr>\n<td>1/8"</td>\n<td>.125"</td>\n<td>.062"</td>\n<td>.020"</td>\n</tr>\n<tr>\n<td>3/16"</td>\n<td>.187"</td>\n<td>.093"</td>\n<td>.020"</td>\n</tr>\n<tr>\n<td>1/4"</td>\n<td>.250"</td>\n<td>.125"</td>\n<td>.025"</td>\n</tr>\n<tr>\n<td>3/8"</td>\n<td>.375"</td>\n<td>.187"</td>\n<td>.025"</td>\n</tr>\n<tr>\n<td>1/2"</td>\n<td>.500"</td>\n<td>.250"</td>\n<td>.025"</td>\n</tr>\n<tr>\n<td>3/4"</td>\n<td>.750"</td>\n<td>.375"</td>\n<td>.030"</td>\n</tr>\n<tr>\n<td>1"</td>\n<td>1.000"</td>\n<td>.500"</td>\n<td>.035"</td>\n</tr>\n</tbody>\n</table>\n</div>\n</div>\n&nbsp;\n\n<a href="wp-content/uploads/2018/08/IP34SR.pdf" target="_blank" rel="noopener">Download Our Spec Sheet</a>',
