    content:
      '<div id="productPageTop" class="row">\n<div id="productImage" class="col-lg-4 col-md-4 col-sm-4 col-xs-12"><img src="wp-content/uploads/2016/07/IP42MW.png" alt="Shrink over terminals for insulation and strain relief." width="360" /></div>\n<div id="productSummary" class="col-lg-8 col-md-8 col-sm-8 col-xs-12">\n<h2>Product Number IP42MW</h2>\n<ul class="summaryList">\n \t<li>Semi-rigid</li>\n \t<li>Encapsulating</li>\n \t<li>High shrink ratio</li>\n</ul>\n\n<hr />\n\n<div class="summaryText">Meltable inner liner for encapsulating</div>\n</div>\n</div>\n<div id="productPageBottom" class="row">\n<div id="productDescription" class="col-lg-8 col-md-8 col-sm-12 col-xs-12">\n\nMelt Wall Polyolefin Tubing is a semi-rigid heat shrinkable tubing that is coextruded and selectively cross-linked to provide a tough protective outer shrinkable jacket with a meltable inner wall.\n\nWith the application of heat in access of 135°C the inner wall melts and is forced by the outer wall to flow in and around all underlying surfaces and small voids. When cool, the tubing becomes one solid mass excellent for encapsulating delicate components from moisture and the attack of chemicals and solvents.\n\nMelt Wall Polyolefin Tubing is recommended for a wide variety of electronic, electrical and mechanical applications...wherever a highly reliable one-step approach to jacketing, encapsulation and environmental sealing is required.\n\n</div>\n<div id="productBoxes" class="col-lg-4 col-md-4 col-sm-12 col-xs-12">\n<dl>\n \t<dd>AMS 3634\nU/L Approved</dd>\n \t<dd>AMS-DTL-23053/4 Class 1</dd>\n \t<dd>(QPL products available upon request)</dd>\n</dl>\n<dl>\n \t<dt>Shrink Ratio:</dt>\n \t<dd>2.5:1</dd>\n \t<dt>Longitudinal Shrinkage:</dt>\n \t<dd>+1/-10%</dd>\n \t<dt>Continuous Operating Temp:</dt>\n \t<dd>-55°C to 110°C</dd>\n \t<dt>Shrink Temperature:</dt>\n \t<dd>135°C</dd>\n \t<dt>Colors:</dt>\n \t<dd>Black standard - others on quote</dd>\n</dl>\n</div>\n<div id="productSpecs" class="col-xs-12">\n<h2>Specifications:</h2>\n&nbsp;\n<table class="tabledata">\n<thead>\n<tr>\n<th>Order Size</th>\n<th>Expanded Diameter</th>\n<th>Recovered Diameter</th>\n<th>Recovered Wall</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>1/8"</td>\n<td>.125"</td>\n<td>.023</td>\n<td>.038</td>\n</tr>\n<tr>\n<td>3/16"</td>\n<td>.187"</td>\n<td>.060</td>\n<td>.043</td>\n</tr>\n<tr>\n<td>1/4"</td>\n<td>.250"</td>\n<td>.080</td>\n<td>.047</td>\n</tr>\n<tr>\n<td>3/8"</td>\n<td>.375"</td>\n<td>.135</td>\n<td>.050</td>\n</tr>\n<tr>\n<td>1/2"</td>\n<td>.500"</td>\n<td>.195</td>\n<td>.055</td>\n</tr>\n<tr>\n<td>3/4"</td>\n<td>.750"</td>\n<td>.313</td>\n<td>.065</td>\n</tr>\n<tr>\n<td>1"</td>\n<td>1.000"</td>\n<td>.400</td>\n<td>.075</td>\n</tr>\n</tbody>\n</table>\n</div>\n</div>\n&nbsp;\n\n<a href="wp-content/uploads/2018/08/IP42MW.pdf" target="_blank" rel="noopener">Download Our Spec Sheet</a>',
