    content:
      '<div id="productPageTop" class="row">\n<div id="productImage" class="col-lg-4 col-md-4 col-sm-4 col-xs-12"><img src="wp-content/uploads/2016/07/IP44A2.png" alt="adhesive liner seals out moisture" width="360" /></div>\n<div id="productSummary" class="col-lg-8 col-md-8 col-sm-8 col-xs-12">\n<h2>Product Number IP44A2 &amp; IP45A3</h2>\n<ul class="summaryList">\n \t<li>Flexible, thin wall</li>\n \t<li>2:1 &amp; 3:1 shrink ratio</li>\n \t<li>Flame retardant outer jacket</li>\n</ul>\n\n<hr />\n\n<div class="summaryText">adhesive liner seals out moisture</div>\n</div>\n</div>\n<div id="productPageBottom" class="row">\n<div id="productDescription" class="col-lg-8 col-md-8 col-sm-12 col-xs-12">\n\nAdhesive Lined Heat Shrink Tubing is a flexible polyolefin lined with a thin layer of special thermoplastic adhesive for excellent moisture protection and strain relief.\n\nThis tubing offers convenient protection of electrical components, wire splices or bundling of wires. Automotive, truck and marine wiring splices and connections are quickly and easily protected from harsh environments\n\nWith the application of heat Adhesive Lined Heat Shrink Tubing shrinks to a tight fit, forcing the adhesive lining to flow and cover the substrate. When cooled the adhesive forms a permanent, flexible and waterproof barrier.\n\nThe tubing is availble in a standard 2 to 1 shrink (product #IP44A2), and also as a 3 to 1 shrink (product #IP45A3) for hard to fit applications.\n\nFor larger diameters see product #IP47HV Heavy Wall Polyolefin Tubing.\n\n</div>\n<div id="productBoxes" class="col-lg-4 col-md-4 col-sm-12 col-xs-12">\n<dl>\n \t<dd>Product #IP44A2 only:</dd>\n \t<dd>U/L Approved, AMS-DTL-23053/4 Class 2</dd>\n \t<dd></dd>\n \t<dd></dd>\n \t<dd>Product #IP45A3 only:</dd>\n \t<dd>U/L Approved, AMS-DTL-23053/4 Class 3</dd>\n \t<dd></dd>\n \t<dd>(QPL products available upon request)</dd>\n</dl>\n<dl>\n \t<dt>Shrink Temperature:</dt>\n \t<dd>121°C</dd>\n \t<dt>Electrical:</dt>\n \t<dd>500 Volts/Mil</dd>\n \t<dt>Standard Lengths 4\'</dt>\n \t<dd> (spool lengths available on request)</dd>\n \t<dt>Markers and Cut Pieces:</dt>\n \t<dd>Cutting and printing on this tubing is available - call for a quotation.</dd>\n</dl>\n</div>\n<div id="productSpecs" class="col-xs-12">\n<h2>Specifications:</h2>\n<table class="tabledata">\n<thead>\n<tr>\n<th>Order Size</th>\n<th>Expanded Diameter</th>\n<th>Recovered Diameter</th>\n<th>Recovered Wall</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td colspan="4">2:1 Shrink</td>\n</tr>\n<tr>\n<td>1/8"</td>\n<td>.125"</td>\n<td>.062"</td>\n<td>.027</td>\n</tr>\n<tr>\n<td>3/16"</td>\n<td>.187"</td>\n<td>.093"</td>\n<td>.027</td>\n</tr>\n<tr>\n<td>1/4"</td>\n<td>.250"</td>\n<td>.125"</td>\n<td>.030</td>\n</tr>\n<tr>\n<td>3/8"</td>\n<td>.375"</td>\n<td>.187"</td>\n<td>.030</td>\n</tr>\n<tr>\n<td>1/2"</td>\n<td>.500"</td>\n<td>.250"</td>\n<td>.030</td>\n</tr>\n<tr>\n<td>3/4"</td>\n<td>.750"</td>\n<td>.375"</td>\n<td>.035</td>\n</tr>\n<tr>\n<td>1"</td>\n<td>1.000"</td>\n<td>.500"</td>\n<td>.043</td>\n</tr>\n<tr>\n<td>1-1/2"</td>\n<td>1.250"</td>\n<td>.625"</td>\n<td>.047</td>\n</tr>\n<tr>\n<td colspan="4">3:1 Shrink</td>\n</tr>\n<tr>\n<td>1/8"</td>\n<td>.118</td>\n<td>.039</td>\n<td>.039</td>\n</tr>\n<tr>\n<td>3/16"</td>\n<td>.188</td>\n<td>.063</td>\n<td>.039</td>\n</tr>\n<tr>\n<td>1/4"</td>\n<td>.236</td>\n<td>.079</td>\n<td>.039</td>\n</tr>\n<tr>\n<td>3/8"</td>\n<td>.354</td>\n<td>.118</td>\n<td>.055"</td>\n</tr>\n<tr>\n<td>1/2"</td>\n<td>.472</td>\n<td>.157</td>\n<td>.070”</td>\n</tr>\n<tr>\n<td>3/4"</td>\n<td>.709</td>\n<td>.236</td>\n<td>.088"</td>\n</tr>\n<tr>\n<td>1”</td>\n<td>.945</td>\n<td>.314</td>\n<td>.100</td>\n</tr>\n<tr>\n<td>1-1/2”</td>\n<td>1.535</td>\n<td>.512</td>\n<td>.100</td>\n</tr>\n</tbody>\n</table>\n<a href="wp-content/uploads/2018/08/IP44A2-IP45A3.pdf" target="_blank" rel="noopener">Download Our Spec Sheet</a>\n\n</div>\n</div>',
