    content:
      '<div id="productPageTop" class="row">\n<div id="productImage" class="col-lg-4 col-md-4 col-sm-4 col-xs-12"><img src="wp-content/uploads/2016/07/IP49VP.png" alt="Works great as a strain relief" width="360" /></div>\n<div id="productSummary" class="col-lg-8 col-md-8 col-sm-8 col-xs-12">\n<h2>Product Number IP49VP</h2>\n<ul class="summaryList">\n \t<li>Very flexible polyolefin</li>\n \t<li>Low shrink temperature</li>\n \t<li>Highly flame retardant</li>\n</ul>\n\n<hr />\n\n<div class="summaryText">Works great as a strain relief</div>\n</div>\n</div>\n<div id="productPageBottom" class="row">\n<div id="productDescription" class="col-lg-8 col-md-8 col-sm-12 col-xs-12">\n\nVery Flexible Heat Shrinkable Polyolefin Tubing is the most flexible tubing we offer. Its high degree of flexibility along with low shrink temperature and high flame retardancy, allow a wide range of applications with a single tubing.\n\nRated at 135°C this tubing has been engineered to offer a low shrink temperature of 100°C. This allows the tubing to shrink rapidly, thereby minimizing heat exposure and possible damage to sensitive substrate materials or components.\n\nThis tubing is ideal for aircraft / aerospace assemblies where flexible wire bundling and fire resistant covering of components is needed.\n\n</div>\n<div id="productBoxes" class="col-lg-4 col-md-4 col-sm-12 col-xs-12">\n<dl>\n \t<dd>U/L 224\nCSA\nMIL-R-46846, type V\nAMS-3587</dd>\n</dl>\n<dl>\n \t<dt>Temperature Rating:</dt>\n \t<dd> -55°C to 135°C</dd>\n \t<dt>Shrink Temperature:</dt>\n \t<dd>100°C</dd>\n \t<dt>Shrink Ratio:</dt>\n \t<dd>2:1</dd>\n \t<dt>Electrical:</dt>\n \t<dd>800 V/mil</dd>\n \t<dt>Tensile Strength:</dt>\n \t<dd>800 V/mil</dd>\n \t<dt>Standard Colors:</dt>\n \t<dd>black, white and yellow</dd>\n</dl>\n</div>\n<div id="productSpecs" class="col-xs-12">\n<h2>Specifications:</h2>\n<table class="tabledata">\n<thead>\n<tr>\n<th>Order Size</th>\n<th>Expanded Diameter</th>\n<th>Recovered Diameter</th>\n<th>Recovered Wall</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>3/64"</td>\n<td>.046"</td>\n<td>.023"</td>\n<td>.016</td>\n</tr>\n<tr>\n<td>1/16"</td>\n<td>.063"</td>\n<td>.031"</td>\n<td>.017</td>\n</tr>\n<tr>\n<td>3/32"</td>\n<td>.093"</td>\n<td>.046"</td>\n<td>.020"</td>\n</tr>\n<tr>\n<td>1/8"</td>\n<td>.125"</td>\n<td>.062"</td>\n<td>.020"</td>\n</tr>\n<tr>\n<td>3/16"</td>\n<td>.187"</td>\n<td>.093"</td>\n<td>.020"</td>\n</tr>\n<tr>\n<td>1/4"</td>\n<td>.250"</td>\n<td>.125"</td>\n<td>.025"</td>\n</tr>\n<tr>\n<td>3/8"</td>\n<td>.375"</td>\n<td>.187"</td>\n<td>.025"</td>\n</tr>\n<tr>\n<td>1/2"</td>\n<td>.500"</td>\n<td>.250"</td>\n<td>.025"</td>\n</tr>\n<tr>\n<td>3/4"</td>\n<td>.750"</td>\n<td>.375"</td>\n<td>.030"</td>\n</tr>\n<tr>\n<td>1"</td>\n<td>1.000"</td>\n<td>.500"</td>\n<td>.035"</td>\n</tr>\n<tr>\n<td>1-1/2"</td>\n<td>1.500"</td>\n<td>.750"</td>\n<td>.040"</td>\n</tr>\n<tr>\n<td>2"</td>\n<td>2.000"</td>\n<td>1.000"</td>\n<td>.045"</td>\n</tr>\n</tbody>\n</table>\n</div>\n</div>\n&nbsp;\n\n<a href="wp-content/uploads/2016/07/IP49VP-2016.pdf" target="_blank">Download Our Spec Sheet</a>',
