    tagline: "Heat Shrink Tubing > Polyolefin",
    link: "/heat-shrink-tubing/polyolefin/medical-grade-polyolefin-tubing/",
    content:
      '<div id="productPageTop" class="row">\n<div id="productImage" class="col-lg-4 col-md-4 col-sm-4 col-xs-12"><img src="wp-content/uploads/2016/07/IP53MP.png" alt="Meets the most stringent medical application requirements." width="360" /></div>\n<div id="productSummary" class="col-lg-8 col-md-8 col-sm-8 col-xs-12">\n<h2>Product Number IP53MP</h2>\n<ul class="summaryList">\n \t<li>Economical Medical Grade Tubing</li>\n \t<li>Meets USP Class VI</li>\n \t<li>Resists a wide range of chemicals</li>\n</ul>\n\n<hr />\n\n<div class="summaryText">Meets the most stringent medical application requirements</div>\n</div>\n</div>\n<div id="productPageBottom" class="row">\n<div id="productDescription" class="col-lg-8 col-md-8 col-sm-12 col-xs-12">\n\nIP53MP is a flexible, heat shrinkable tubing with superior electrical properties and was developed to meet the most stringent medical application requirements.\n\nMade from medical grade polyolefin, it has excellent dielectric, chemical and physical properties\n\nApplication of heat above 121°C will shrink this tubing quickly to 50% of its supplied diameter or snug down on the object it is to cover.\n\nResists a wide range of chemicals, such as hexachlorophene (pHisohex), saline solution, povidoneiodine (Betadine), benzalkonium (Zephiran), alcohol, as well as moisture and fungus.\n\n</div>\n<div id="productBoxes" class="col-lg-4 col-md-4 col-sm-12 col-xs-12">\n<dl>\n \t<dd>USP XXII, NF XVII,\nUSP Class VI (Minimum)</dd>\n</dl>\n<dl>\n \t<dt>Longitudinal Shrinkage:</dt>\n \t<dd>5%</dd>\n \t<dt>Autoclave Cycle Test:</dt>\n \t<dd>20 cycles @ 121°c psig for 15 min. with fast dry cycle, followed by test for:\nVolume Resistivity ASTMD257 @ 500 volts No Change from original\nDielectric Strength ASTMD149 In air @ 500 kv/min rise No Change from original\nDielectric Constant ASTMD150 @ 1 Mhz No Change from original\nDissipation Factor ASTMD150 @ 1 Mhz No Change from original</dd>\n \t<dt>Temperature Rating:</dt>\n \t<dd>continuous operation from -55°C to 121°C.</dd>\n \t<dt>Standard Colors:</dt>\n \t<dd>black, white, clear, blue</dd>\n</dl>\n</div>\n<div id="productSpecs" class="col-xs-12">\n<h2>Specifications:</h2>\n<table class="tabledata">\n<thead>\n<tr>\n<th>Order Size</th>\n<th>Expanded Diameter</th>\n<th>Recovered Diameter</th>\n<th>Recovered Wall</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>3/32"</td>\n<td>.093"</td>\n<td>.046"</td>\n<td>.020"</td>\n</tr>\n<tr>\n<td>1/8"</td>\n<td>.125"</td>\n<td>.062"</td>\n<td>.020"</td>\n</tr>\n<tr>\n<td>3/16"</td>\n<td>.187"</td>\n<td>.093"</td>\n<td>.020"</td>\n</tr>\n<tr>\n<td>1/4"</td>\n<td>.250"</td>\n<td>.125"</td>\n<td>.025"</td>\n</tr>\n<tr>\n<td>3/8"</td>\n<td>.375"</td>\n<td>.187"</td>\n<td>.025"</td>\n</tr>\n<tr>\n<td>1/2"</td>\n<td>.500"</td>\n<td>.250"</td>\n<td>.025"</td>\n</tr>\n</tbody>\n</table>\n</div>\n</div>\n&nbsp;\n\n<a href="wp-content/uploads/2016/07/IP53MP-2016.pdf" target="_blank">Download Our Spec Sheet</a>',
