    content:
      '<div id="productPageTop" class="row">\n<div id="productImage" class="col-lg-4 col-md-4 col-sm-4 col-xs-12"><img src="wp-content/uploads/2016/07/IP30HS.png" alt="Inexpensive low shrink temperature tubing ." width="360" /></div>\n<div id="productSummary" class="col-lg-8 col-md-8 col-sm-8 col-xs-12">\n<h2>Product Number IP30HS</h2>\n<ul class="summaryList">\n \t<li>Low shrink temperature</li>\n \t<li>2:1 shrink low cost</li>\n \t<li>U/L CSA MIL-Spec.</li>\n</ul>\n\n<hr />\n\n<div class="summaryText">Inexpensive low shrink temperature tubing</div>\n</div>\n</div>\n<div id="productPageBottom" class="row">\n<div id="productDescription" class="col-lg-8 col-md-8 col-sm-12 col-xs-12">\n\nHeat Shrinkable PVC Tubing provides excellent electrical insulation along with the lowest shrink temperature of any of our tubings. When high shrink temperatures can damage enclosed or adjacent components this tubing is the best choice. PVC tubing shrinks a full 50% quickly at 200°F.\n\nApproximately 20% longitudinal shrinkage allows ripple free conformance around sharp bends to form a tight fitting insulation for most general applications with a high degree of flexibility.\n\nResists most chemicals and oils as well as sunlight, moisture and fungus.\n\nAlso available in Irradiated (product #IP32IP) and 1/32” heavy wall.\n\n</div>\n<div id="productBoxes" class="col-lg-4 col-md-4 col-sm-12 col-xs-12">\n<dl>\n \t<dd>U/L Subject 224 VW-1\nRated for 600V\nU/L File #E28044\nCSA, OFT\nCSA File #41513\nASTM D 3150\nAMS-DTL-23053/2 class 2</dd>\n</dl>\n<dl>\n \t<dt>Longitudinal Shrinkage:</dt>\n \t<dd>20%</dd>\n \t<dt>Storage:</dt>\n \t<dd>extremely heat sensitive; store at 70°F or below, or use in 30 days</dd>\n \t<dt>Temperature Rating:</dt>\n \t<dd>continuous operation from -20°C to 105°C.</dd>\n \t<dt>Electrical:</dt>\n \t<dd>1083 volts per mil.</dd>\n \t<dt>Colors:</dt>\n \t<dd>black, white, clear, red and yellow (other colors available with special quotation).</dd>\n</dl>\n</div>\n<div id="productSpecs" class="col-xs-12">\n<h2>Specifications:</h2>\n<table class="tabledata">\n<thead>\n<tr>\n<th>Order Size</th>\n<th>Expanded Diameter</th>\n<th>Recovered Diameter</th>\n<th>Recovered Wall</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>3/64"</td>\n<td>.046"</td>\n<td>.023"</td>\n<td>.020”</td>\n</tr>\n<tr>\n<td>1/16"</td>\n<td>.063"</td>\n<td>.031"</td>\n<td>.020”</td>\n</tr>\n<tr>\n<td>3/32"</td>\n<td>.093"</td>\n<td>.046"</td>\n<td>.025”</td>\n</tr>\n<tr>\n<td>1/8"</td>\n<td>.125"</td>\n<td>.062"</td>\n<td>.025”</td>\n</tr>\n<tr>\n<td>3/16"</td>\n<td>.187"</td>\n<td>.093"</td>\n<td>.025”</td>\n</tr>\n<tr>\n<td>1/4"</td>\n<td>.250"</td>\n<td>.125"</td>\n<td>.025”</td>\n</tr>\n<tr>\n<td>5/16”</td>\n<td>.313”</td>\n<td>.157”</td>\n<td>.028”</td>\n</tr>\n<tr>\n<td>3/8"</td>\n<td>.375"</td>\n<td>.187"</td>\n<td>.028”</td>\n</tr>\n<tr>\n<td>1/2"</td>\n<td>.500"</td>\n<td>.250"</td>\n<td>.028”</td>\n</tr>\n<tr>\n<td>5/8"</td>\n<td>.625"</td>\n<td>.313"</td>\n<td>.033</td>\n</tr>\n<tr>\n<td>3/4"</td>\n<td>.750"</td>\n<td>.375"</td>\n<td>.033”</td>\n</tr>\n<tr>\n<td>1"</td>\n<td>1.000"</td>\n<td>.500"</td>\n<td>.038”</td>\n</tr>\n<tr>\n<td>1-1/4"</td>\n<td>1.250"</td>\n<td>.625"</td>\n<td>.041”</td>\n</tr>\n<tr>\n<td>1-1/2"</td>\n<td>1.500"</td>\n<td>.750"</td>\n<td>.043”</td>\n</tr>\n<tr>\n<td>2"</td>\n<td>2.000"</td>\n<td>1.000"</td>\n<td>.048"</td>\n</tr>\n<tr>\n<td>3"</td>\n<td>3.000"</td>\n<td>1.500"</td>\n<td>.068"</td>\n</tr>\n<tr>\n<td>4"</td>\n<td>4.000"</td>\n<td>2.000"</td>\n<td>.073"</td>\n</tr>\n</tbody>\n</table>\n</div>\n</div>\n&nbsp;\n\n<a href="wp-content/uploads/2016/07/IP30HS-2016.pdf" target="_blank">Download Our Spec Sheet</a>',
