    title: "Layflat PVC Heat Shrink Tubing",
    tagline: "Heat Shrink Tubing > PVC",
    link: "/heat-shrink-tubing/pvc/layflat-pvc-heat-shrink-tubing/",
    content:
      '<div id="productPageTop" class="row">\n<div id="productImage" class="col-lg-4 col-md-4 col-sm-4 col-xs-12"><img src="wp-content/uploads/2016/07/IP3L.png" alt="Ultra thin wall for battery and pharmaceutical applications" width="360" /></div>\n<div id="productSummary" class="col-lg-8 col-md-8 col-sm-8 col-xs-12">\n<h2>Product Number IP3L</h2>\n<ul class="summaryList">\n \t<li>General purpose flexible polyolefin</li>\n \t<li>Flame retardant</li>\n \t<li>U/L, MIL-Spec.</li>\n</ul>\n\n<hr />\n\n<div class="summaryText">Ultra thin wall for battery and pharmaceutical applications</div>\n</div>\n</div>\n<div id="productPageBottom" class="row">\n<div id="productDescription" class="col-lg-8 col-md-8 col-sm-12 col-xs-12">\n\nLayflat PVC Heat Shrink Tubing is a thin-wall, low cost material offering good electrical and mechanical characteristics. When exposed to heat in excess of 275°F for a few seconds, the specially formulated polyvinyl chloride material will shrink rapidly and uniformly conforming to the shape of the object to be covered.\n\nLayflat PVC is available in diameters from .250” to 6” and larger. The standard wall thickness is .004” and .006” but is also available as thin as .0015” and as thick as .012” (for thicker walls use product #IP30HS). Standard colors are white, black and clear but can be special ordered in almost any color.\n\nApplications include insulation and jacketing of batteries, capacitors and similar objects - a vast range of applications in the production of industrial equipment, toys, sporting goods, electronics, medical and consumer products\n\nA portable heat gun can be used for shrinking in most applications.\n\n</div>\n<div id="productBoxes" class="col-lg-4 col-md-4 col-sm-12 col-xs-12">\n<dl>\n \t<dd>U/L VW-1\nU/L file #E129478</dd>\n</dl>\n<dl>\n \t<dt>Electrical:</dt>\n \t<dd>Dielectric Strength: (.004) 2400 volts/mil</dd>\n \t<dt>Thermal:</dt>\n \t<dd>Operating Temperature: +100°C to -20°C\nCold Brittleness: 20°C\nHeat Shock: 121°C, 1hr - no flowing, dripping</dd>\n \t<dd> or cracking</dd>\n \t<dd>High Temperature Resistance: 200hrs at 100°C</dd>\n \t<dt>Shrink Ratio:</dt>\n \t<dd>up to 50%</dd>\n \t<dt>Standard Colors:</dt>\n \t<dd>black, white and clear (most any color available on special order)</dd>\n</dl>\n</div>\n<div id="productSpecs" class="col-xs-12">\n<h2>Specifications:</h2>\n<table class="tabledata">\n<thead>\n<tr>\n<th colspan="3">Layflat is measured in millimeters flat width, in the range from 5mm up to 250mm and larger. Common sizes are shown below but many others are available</th>\n</tr>\n<tr>\n<th>battery size</th>\n<th>diameter</th>\n<th>flat width</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>3A</td>\n<td>7/16”</td>\n<td>17.5 to 19mm</td>\n</tr>\n<tr>\n<td>2A</td>\n<td>9/16”</td>\n<td>23 to 24.5mm</td>\n</tr>\n<tr>\n<td>N</td>\n<td>1/2”</td>\n<td>19 to 21.5mm</td>\n</tr>\n<tr>\n<td>sub C</td>\n<td>7/8”</td>\n<td>.36 to 40mm</td>\n</tr>\n<tr>\n<td>C</td>\n<td>1-1/8”</td>\n<td>42 to 48mm</td>\n</tr>\n<tr>\n<td>D</td>\n<td>1-3/8”</td>\n<td>56 to 60mm</td>\n</tr>\n<tr>\n<td>9V</td>\n<td>1-1/8”</td>\n<td>56 to 60mm</td>\n</tr>\n</tbody>\n</table>\n</div>\n</div>\n&nbsp;\n\n<a href="wp-content/uploads/2016/07/Layflat-PVC-2016.pdf" target="_blank" rel="noopener">Download Our Spec Sheet</a>',
