    content:
      '<div id="productPageTop" class="row">\n<div id="productImage" class="col-lg-4 col-md-4 col-sm-4 col-xs-12"><img src="wp-content/uploads/2016/07/tubingkits.png" alt="Shrink over terminals for insulation and strain relief." width="360" /></div>\n<div id="productSummary" class="col-lg-8 col-md-8 col-sm-8 col-xs-12">\n<h2>Product Number KITS</h2>\n<ul class="summaryList">\n \t<li>Custom upon request</li>\n \t<li>Any type of tubing</li>\n \t<li>Divided boxes and single tubs</li>\n</ul>\n\n<hr />\n\n<div class="summaryText"></div>\n</div>\n</div>\n<div id="productPageBottom" class="row">\n<div id="productDescription" class="col-lg-8 col-md-8 col-sm-12 col-xs-12">\n\nInsulation Products Corporation can make up kits to your specifications in single tubs, multiple slot boxes or zipper bags. Let us know what your needs are and we will help you with the layout, sizing and types of tubing that will work for your application.\n\nKits can include our tubing, your tubing or a combination of both. Tubing can be marked with the corresponding size and type or even show your name and logo.\n\nThe boxes, bags or tubs can be labeled with your information, contents, and/or part numbers.\n\nOur kits are great for Salesperson samples inside the office or out on the road.\n\nPlease contact a salesperson for details.\n\n</div>\n</div>\n<div id="productPageBottom" class="row">\n<div id="productBoxes" class="col-lg-4 col-md-4 col-sm-12 col-xs-12"><a href="wp-content/uploads/2016/07/Tubing-Kits-2016.pdf" target="_blank">Download Our Spec Sheet</a></div>\n</div>',
