    title: "Identification Markers for Wire, Cable & Ropes",
    tagline: "Specialty Products & Services",
    link: "/specialty-products-services/identification-markers-for-wire-and-cable/",
    content:
      '<div id="productPageTop" class="row">\n<div id="productImage" class="col-lg-4 col-md-4 col-sm-4 col-xs-12"><a href="wp-content/uploads/2016/07/Marker-Sample-2.jpg"><img class="alignnone size-medium wp-image-1373" src="wp-content/uploads/2016/07/Marker-Sample-2-300x200.jpg" alt="Marker Sample (2)" width="300" height="200" /></a></div>\n<div id="productSummary" class="col-lg-8 col-md-8 col-sm-8 col-xs-12">\n<h2>Identification Markers for Wire, Cable &amp; Ropes</h2>\n<ul class="summaryList">\n \t<li>Hot stamped on shrinkable or non-shrinkable tubing and cable ties</li>\n \t<li>Large stock of tubing and cable ties for immediate delivery</li>\n \t<li>Custom made to your specifications</li>\n \t<li>No minimum quantity</li>\n</ul>\n\n<hr />\n\n<div class="summaryText"></div>\n</div>\n</div>\n<div id="productPageBottom" class="row">\n<div id="productDescription" class="col-lg-8 col-md-8 col-sm-12 col-xs-12">\n\nInsulation Products Corporation\'s hot stamp markers are a low cost, simple, attractive and completely dry process for marking or coding wire, cable, ropes and other parts for identification\n\nHot stamp markers identify or finish products to improve profits by increasing production, efficiency and appearance. Parts can be customized with manufacturers logo, part number, date code and serial number on all types of sleevings, heat shrinkable tubing and cable ties. A wide selection of type sizes, tubing colors and imprint colors give that finished look to your product.\n\nInsulation Products Corporation will mark on U/ L, CSA and military approved materials with a quality permanent imprint, cut to length and package to the customer\'s needs. No minimum quantity is required per order.\n\nWith new, high speed, automated, cutting and stamping equipment, orders are normally shipped in one to two weeks.\n\n<a href="wp-content/uploads/2016/07/Markers-2016.pdf">Download Our Spec Sheet</a>\n\n</div>\n<div id="productBoxes" class="col-lg-4 col-md-4 col-sm-12 col-xs-12">\n<dl>\n \t<dt>Ordering Data &amp; Specifications:</dt>\n \t<dd>- Type is standard Gothic unless otherwise specified\n- Standard print color is black or white (other colors available)\n- Tubing sizes from 3/64" up to 5" diameter\n- Standard character sizes from 1/16" to 1/2"\n- Custom sizes available - Markings on both sides available\n- Serialization available\n- On the chart to the right "D" is the inside diameter\n--- "L" is the length to cut the tubing\n- Maximum 6 lines of type using 1/8" characters\n- We will mark to these Military Specifications</dd>\n \t<dd>--- MIL-STD-130: Identification marking of U.S. Military property\n--- MIL-M-81531: Marking of electrical insulating materials\n--- MIL-M-60903: Marking of electrical wires and cables (#7444)</dd>\n</dl>\n</div>\n</div>',
