    content:
      '<div id="productPageTop" class="row">\n<div id="productImage" class="col-lg-4 col-md-4 col-sm-4 col-xs-12"><img src="wp-content/uploads/2016/07/heatgun.png" alt="Shrinks any tubing with variable temperature" width="360" /></div>\n<div id="productSummary" class="col-lg-8 col-md-8 col-sm-8 col-xs-12">\n<h2>Product Number VT-1100</h2>\n<ul class="summaryList">\n \t<li>Variable Temperature</li>\n \t<li>Two Speed Motor</li>\n \t<li>Solid State</li>\n</ul>\n\n<hr />\n\n<div class="summaryText">Shrinks any tubing with variable temperature</div>\n</div>\n</div>\n<div id="productPageBottom" class="row">\n<div id="productDescription" class="col-lg-8 col-md-8 col-sm-12 col-xs-12">\n\nOur VT-1100 variable temperature heat gun allows the user to dial in the correct shrink temperature for whatever tubing is being used - from sensitive, low-temperature PVCs to hard to shrink, high-temperature PTFE. Lightweight yet rugged, this gun can be used for every application from production lines to the occasional user.\n\nAttachments are available for shrinking small diameter or large diameter tubing along with a pinpoint attachment to control heat to a selected point.\n\nA larger bench to heat gun is available for production lines where continuous operation for extended periods is needed.\n\n<a href="wp-content/uploads/2016/07/Heat-Gun-2016.pdf" target="_blank" rel="noopener noreferrer">Download Our Spec Sheet</a>\n\n</div>\n<div id="productBoxes" class="col-lg-4 col-md-4 col-sm-12 col-xs-12">\n<dl>\n \t<dd>UL &amp; CSA Approved\n1200 Watts\n120 VAC/10 Amp\nWeighs only 1.6 lbs</dd>\n</dl>\n<dl>\n \t<dt></dt>\n \t<dd>Variable Temperature Control Dial\nTemperature from 250°F – 1100°F\nSolid State Construction\nTwo Speed Motor\nHigh Quality Heat Element\nBuilt in Safety Stand</dd>\n</dl>\n<dl>\n \t<dt></dt>\n</dl>\n</div>\n</div>',
