    content:
      '<div id="productPageTop" class="row">\n<div id="productImage" class="col-lg-4 col-md-4 col-sm-4 col-xs-12"><a href="wp-content/uploads/2016/07/Non-Metallic-Coupling.jpg"><img class="alignnone size-medium wp-image-1371" src="wp-content/uploads/2016/07/Non-Metallic-Coupling-300x238.jpg" alt="Non-Metallic Coupling" width="300" height="238" /></a></div>\n<div id="productSummary" class="col-lg-8 col-md-8 col-sm-8 col-xs-12">\n<h2>Product Number CC</h2>\n\n<hr />\n\n<ul>\n \t<li class="summaryText">Couplings for long length runs</li>\n \t<li class="summaryText">Smooth internal surfaces for easier wire installation</li>\n \t<li class="summaryText">For use with Flexible, Non-Metallic Electrical Tubing</li>\n \t<li class="summaryText">Liquid-Tight</li>\n</ul>\n<div class="summaryText"></div>\n</div>\n</div>\n<div id="productPageBottom" class="row">\n<div id="productDescription" class="col-lg-8 col-md-8 col-sm-12 col-xs-12">\n\n UL &amp; CUL listed\n\n Produced from UV rated material for long outdoor life\n\n Attractive one-piece design\n\n Less waste! No need to throw away those odd length pieces\n\n Simply screw the coupling unto two pieces simultaneously to make one continuous piece\n\n Snake long lengths of conduit with ease by cutting the conduit, placing wire &amp; reconnecting\n\n Design allows superior liquid-tight seal &amp; optimum pull strength\n\n</div>\n<div id="productBoxes" class="col-lg-4 col-md-4 col-sm-12 col-xs-12">\n<dl>\n \t<dd>Listed under the Underwriters’ Laboratories File Number E197675</dd>\n</dl>\n<dl>\n \t<dd>Outdoor Lighting\nAssemblies\nApplications for long conduit runs\nWire Protection\nLocations where type B conduit is used</dd>\n</dl>\n</div>\n<div id="productSpecs" class="col-xs-12">\n<h2>Specifications:</h2>\n<table class="tabledata">\n<thead>\n<tr>\n<th>Order Size</th>\n<th>Part Dimensions (inches) A</th>\n<th>Part Dimensions (inches) B</th>\n<th>Part Dimensions (inches) C</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>3/8”</td>\n<td>1.725</td>\n<td>0.800</td>\n<td>0.520</td>\n</tr>\n<tr>\n<td>1/2”</td>\n<td>1.725</td>\n<td>0.800</td>\n<td>0.625</td>\n</tr>\n<tr>\n<td>3/4”</td>\n<td>1.725</td>\n<td>0.800</td>\n<td>0.825</td>\n</tr>\n<tr>\n<td>1”</td>\n<td>1.730</td>\n<td>0.810</td>\n<td>1.105</td>\n</tr>\n<tr>\n<td>2”</td>\n<td>4.225</td>\n<td>2.075</td>\n<td>2.100</td>\n</tr>\n<tr>\n<td colspan="4"><img src="wp-content/uploads/2016/07/coulplings2.png" /></td>\n</tr>\n</tbody>\n</table>\n</div>\n</div>\n&nbsp;\n\n<a href="wp-content/uploads/2016/07/Non-Metallic-Coupling-CC-2016.pdf" target="_blank">Download Our Spec Sheet</a>',
