      '<div id="productPageTop" class="row">\n<div id="productImage" class="col-lg-4 col-md-4 col-sm-4 col-xs-12"><img src="wp-content/uploads/2016/07/IP61ES.jpg" alt="Very flexible / conforms to irregular shapes" width="360" /></div>\n<div id="productSummary" class="col-lg-8 col-md-8 col-sm-8 col-xs-12">\n<h2>Product Number IP61ES &amp; IP62EF</h2>\n<ul class="summaryList">\n \t<li>Self-fitting over many shapes and sizes</li>\n \t<li>Rated to 125°C</li>\n</ul>\n\n<hr />\n\n<div class="summaryText">Very flexible / conforms to irregular shapes</div>\n</div>\n</div>\n<div id="productPageBottom" class="row">\n<div id="productDescription" class="col-lg-8 col-md-8 col-sm-12 col-xs-12">\n\nExpandable Polyester Sleeving is a light-weight, encapsulating sleeving designed to expand and adjust to irregular surfaces to protect cable bundles and wire assemblies. It is braided from polyethylene terephthalate monofilament which offers cut-through, chemical and fungus resistance in addition to abrasion resistance\n\nPush the sleeving over large fittings to expand its size. Once over, expandable sleeving becomes a snug, form-fitting cover that adjusts to irregular shapes and contours providing abrasion resistance and protection with a minimum of bulk and weight.\n\nPolyester expandable sleeving is available as a standard U/L recognized product rated for 125°C. It can also be supplied with the added feature of flame retardance. Also U/L recognized for 125°C, the flame retardant version carries U/L\'s highest VW-1 rating.\n\n</div>\n<div id="productBoxes" class="col-lg-4 col-md-4 col-sm-12 col-xs-12">\n<dl>\n \t<dd>U/L Recognized</dd>\n \t<dd>CSA Certified</dd>\n \t<dd>Rated for 125°C</dd>\n \t<dd>Flame Retardant Version U/L VW-1</dd>\n \t<dd>.010” Filament Diameter</dd>\n</dl>\n<dl>\n \t<dd>Available in a heavy wall version for twice the wear resistance.\nExpandable sleeving comes in nine colors.\nRot-free\nDoes not trap heat or humidity</dd>\n</dl>\n</div>\n<div id="productSpecs" class="col-xs-12">\n<h2>Specifications:</h2>\n<table class="tabledata">\n<thead>\n<tr>\n<th>Order Size</th>\n<th>Usage Range: Minimum Size</th>\n<th>Usage Range: Maximum Size</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>1/8"</td>\n<td>3/32"</td>\n<td>1/4"</td>\n</tr>\n<tr>\n<td>1/4"</td>\n<td>1/8"</td>\n<td>5/16"</td>\n</tr>\n<tr>\n<td>3/8"</td>\n<td>1/4"</td>\n<td>1/2"</td>\n</tr>\n<tr>\n<td>1/2"</td>\n<td>3/8"</td>\n<td>5/8"</td>\n</tr>\n<tr>\n<td>3/4"</td>\n<td>5/8"</td>\n<td>1"</td>\n</tr>\n<tr>\n<td>1”</td>\n<td>5/8"</td>\n<td>1-3/8"</td>\n</tr>\n<tr>\n<td>1-1/4"</td>\n<td>1-1/8"</td>\n<td>1-1/2"</td>\n</tr>\n<tr>\n<td>1-1/2"</td>\n<td>1-3/8"</td>\n<td>1-3/4"</td>\n</tr>\n<tr>\n<td>1-3/4"</td>\n<td>1-1/2"</td>\n<td>2-1/4"</td>\n</tr>\n<tr>\n<td>2"</td>\n<td>1-1/2"</td>\n<td>3"</td>\n</tr>\n<tr>\n<td>2-1/2"</td>\n<td>2"</td>\n<td>3-1/2"</td>\n</tr>\n</tbody>\n</table>\n</div>\n</div>\n&nbsp;\n\n<a href="wp-content/uploads/2016/07/IP61ES-IP62EF-2016.pdf" target="_blank" rel="noopener">Download Our Spec Sheet</a>',
