    title: "Roundit® 2000 Sleeving",
    tagline: "Non-Shrink Tubing > Sleeving",
    link: "/non-shrink-tubing/sleeving/roundit-2000-sleeving/",
    content:
      '<div id="productPageTop" class="row">\n<div id="productImage" class="col-lg-4 col-md-4 col-sm-4 col-xs-12"><img src="wp-content/uploads/2016/07/ip63es.jpg" alt="Very flexible / conforms to irregular shapes" width="360" /></div>\n<div id="productSummary" class="col-lg-8 col-md-8 col-sm-8 col-xs-12">\n<h2>Product Number IP63ES</h2>\n<ul class="summaryList">\n \t<li>Self-wrapping design</li>\n \t<li>Rated to 125°C</li>\n \t<li>Ideal for reworking components without disconnecting them</li>\n</ul>\n\n<hr />\n\n<div class="summaryText"></div>\n</div>\n</div>\n<div id="productPageBottom" class="row">\n<div id="productDescription" class="col-lg-8 col-md-8 col-sm-12 col-xs-12">\n\nRoundit® is a tough, light-weight, self-wrapping sleeving designed to allow for quick and easy application and removal. Made from a woven blend of polyester monofilaments and multifilaments in a flat weave construction gives Roundit a rugged yet smooth appearance.\n\nThis sleeving is perfect for applications where a product needs to be supplied that does not disturb the connector or fittings.\n\nRoundit® 2000 sleeving is available as a standard U/L recognized product rated for 125°C. It can also be supplied with the added feature of flame retardance, EMI woven or Nomex.\n\nRoundit® 2000 has many applications in the aeronautical, marine, electronic, furniture accessory and general manufacturing industries.\n\n</div>\n<div id="productBoxes" class="col-lg-4 col-md-4 col-sm-12 col-xs-12">\n<dl>\n \t<dd>U/L Recognized\nRated for 125°C\nTough Fabric Texture\nMelt Temp: 250°C</dd>\n</dl>\n<dl>\n \t<dt></dt>\n \t<dd>Available in different versions\nRoundit should be tied at intervals if continuous temperature exceeds 110°C</dd>\n \t<dt></dt>\n</dl>\n</div>\n<div id="productSpecs" class="col-xs-12">\n<h2>Specifications:</h2>\n<table class="tabledata">\n<thead>\n<tr>\n<th>Order Size</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>3/16"</td>\n</tr>\n<tr>\n<td>5/16"</td>\n</tr>\n<tr>\n<td>1/2"</td>\n</tr>\n<tr>\n<td>3/4"</td>\n</tr>\n<tr>\n<td>1”</td>\n</tr>\n<tr>\n<td>1”</td>\n</tr>\n<tr>\n<td>1-1/4"</td>\n</tr>\n<tr>\n<td>1-1/2"</td>\n</tr>\n</tbody>\n</table>\n</div>\n</div>',
